import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for at least one product price to appear
    await page.waitForSelector('.product-price', { timeout: 5000 });

    // Take screenshot of product grid (if present)
    const productsGrid = await page.$('.products-grid');
    if (productsGrid) {
      await productsGrid.screenshot({ path: path.join(screenshotsDir, 'step_2_products_grid.png') });
      screenshots.push(path.join(screenshotsDir, 'step_2_products_grid.png'));
    }

    // Extract all visible product prices
    const prices = await page.$$eval('.product-price', nodes =>
      nodes.map(node => {
        // Get the main price (exclude original/strikethrough price)
        const priceText = node.childNodes[0]?.textContent || node.textContent || '';
        // Remove $ and whitespace, parse as float
        const match = priceText.match(/[\d,.]+/);
        return match ? match[0].replace(/,/g, '') : '';
      }).filter(Boolean)
    );

    // Take screenshot highlighting product prices (optional: highlight first price)
    if (prices.length > 0) {
      const firstPrice = await page.$('.product-price');
      if (firstPrice) {
        await firstPrice.screenshot({ path: path.join(screenshotsDir, 'step_3_first_price.png') });
        screenshots.push(path.join(screenshotsDir, 'step_3_first_price.png'));
      }
    }

    return {
      success: true,
      action: "Extracted all product prices from the page",
      extractedData: {
        prices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
